import random

# Standard python
class TestTreeGeneratorData(object):

    def get_image_data(self):
        count = len(self.image_data)
        index = random.randint(0, count - 1)
        return self.image_data[index]

    image_data = [
        "data:image/png;base64,",
        "data:image/jpeg;base64,",
        "data:image/png;base64,",
        "data:image/jpeg;base64,"
    ]
